measurements.description:
Three stellate, cream flowers on one unsupported arching 47-cm inflorescence;
four green bracts extending to the lowest pedicle, emerging from a leaf axil of a fusiform pseudobulb;
leaves widest at midlength and slight unequally bilobed;
 72-cm wide by 49-cm tall plant grown in bark and perlite, 15- cm diameter black plastic pot;
 sepals linear; 
 petals narrowly ovate;
 lip cymbiform, blotched and striated burgundy, yellow centrally, keels yellow;
 column overlaid blush rose, anther cap pale yellow; 
 substance firm; texture matte;
 copious nectar noted on inflorescence and flowers.
